import React from 'react';
import '../css/rentalworks.css';
import Rentvideo from '../media/rentalworks.mp4';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Rentalworks = () => {

  return (
    <div >
      <video
        src={Rentvideo}
        muted
        autoPlay={"autoplay"}
        preLoad="auto"
        loop 
      ></video>
      <div  className='banner'>
      <Container>
      <Row>
        <Col sm lg="3">
          <Row>
            <Col>
              <img src='' />
            </Col>
          </Row>
        </Col>
        <Col sm lg="3">
            
        </Col>
        <Col sm lg="3">
            
        </Col>
      </Row>
    </Container>
      </div>
    </div>
  )
}

export default Rentalworks
